import React, { useState, useEffect } from "react";
import { spotifyApi, getAccessToken } from "../components/spotifyAPI";

const Home = () => {


    const [profile, setProfile] = useState()


	useEffect(() => {
		spotifyApi.getMe()
		.then((response) => {
			setProfile(response)
		})
        .catch(() => {
            getAccessToken()
        })
	},[])




	console.log(profile)

    return (
        <h1>Welcome to Spoti-FYI</h1>
    )
}

export default Home
